import React from 'react';
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';
import { Table } from 'antd';
import Unconnect from "./Image/conditionerIcon.png"

    const columns = [{
		dataIndex: 'name',
    }, {
		dataIndex: 'age',
	}, {
		dataIndex: 'address',
    }];

	const data = [{
	  key: '1',
	  name:  <img src={Unconnect}/>,
	  age: <img src={Unconnect}/>,
	  address:  <img src={Unconnect}/>
	}, {
	  key: '2',
	  name:  <img src={Unconnect}/>,
	  age:  <img src={Unconnect}/>,
	  address:  <img src={Unconnect}/>
	}, {
	  key: '3',
	  name: <img src={Unconnect}/>,
	  age: <img src={Unconnect}/>,
	  address: <img src={Unconnect}/>,
	}];

class Rop1 extends React.Component {
  render() {
    return (
      <Table columns={columns} dataSource={data} style={{width:'100px',height:'100px'}}/>
    )
  }
}
export default Rop1;
